COPY public.blog_blogpost (id, title, type_laundry, author, subtitle, slug, short_description, body, meta_description, publish_date, published, image, image_banner) FROM stdin;
1	Charlotte Drive	Tauranga	Bathroom Project By Newtech	Oozing Class with Dark Oak Flavoured Bathrooms	charlotte-drive-tauranga	The chocolately colours used in this bathroom project create a quality homely mood..	<p>This beautiful Tauranga home uses dark chocolately colours throughout their bathrooms creating a quality, homely mood. We love the matching accents on the mirrors and lights which draws out the colour in the Dark Oak vanity.</p>\r\n\r\n<p>Using the Ravani vanity with an inset basin and matching mirror cabinets and teaming it with our beautiful Lexington these bathrooms are dressed to impress. The solid timber vanity units are both beautiful and durable, designed to last for years to come, without any sign of wear.</p>\r\n\r\n<p>The Lexington bath is a great-looking acrylic bath. Functional, beautiful, durable and easy on your wallet too!</p>		2023-04-14 09:41:09.785+00	t	images/project/charlotte-drive.jpeg	images/project/banner/charlotte-drive.jpeg
2	Hypatia Apartments	Auckland	Bathroom Project	Greek Inspired Design in Newmarket	hypatia-apartments	Greek inspired design takes these apartments to a new level of opulence...	<p>Located in centrally Newmarket near the Auckland Domain, the Hypatia Apartments are a retreat from the busy Auckland life.</p>\r\n\r\n<p>Featuring the Newtech Kolum Vanity in American Walnut, with a matching Mirror Cabinet, Castello toilet, and towel rail. The bathroom is beautifully tiled to accentuate the feeling of class throughout.</p>		2023-04-14 10:23:24.31+00	t	images/project/h.jpeg	images/project/banner/h.jpeg
3	Ben LomoDrivend	Dunedin	Bathroom Project	Beautiful Bathrooms in Dunedin	ben-lomond-drive	Modern and stylish. This Dunedin home accentuates the beauty of Newtech bathroomware...	<p>This modern Dunedin home is wonderfully complemented by Newtech&#39;s quality bathroomware.</p>\r\n\r\n<p>The main bathroom features the 42nd Ave freestanding bath, the Kolum wall hung vanity in Gloss White and the Largo Freedom Heated Towel Rail in Chrome.</p>\r\n\r\n<p>The ensuite looks amazing with Newtech&#39;s Ravani solid timber vanity in American Walnut topped with two Eos square vessel basins.</p>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>		2023-04-14 10:25:36.065+00	t	images/project/bld.jpeg	images/project/banner/bld.jpeg
4	Twin Peaks	Queenstown	Bathroom Project	A Remarkable Residence	twin-peaks	This remarkable home in Queenstown discovers the elegance of solid timber vanities...	<p>With stunning views of the remarkables this Queenstown residence is truly incredible.</p>\r\n\r\n<p>With wooden Oak accents throughout the home, the solid timber Ravani vanity matched the style that owners Natalia and Myles hoped to create.</p>\r\n\r\n<p>Topped with a Stonecast Slab top and Eos rectangular vessel basin, this vanity fits right into this stunning house.</p>\r\n\r\n<p>Accompanying the Ravinty vanity is the Newark back-to-wall freestanding bath. Of Acrylic construction, this bath is both stylish and durable, without hurting the wallet!</p>\r\n\r\n<p>Photos credit of&nbsp;<a href="https://www.homestolove.co.nz/real-homes/home-tours/this-striking-queenstown-house-makes-the-most-of-its-remarkable-views" rel="noopener" target="_blank" title="Beautiful Bathrooms in Queenstown">Homestolove.co.nz</a></p>		2023-04-14 10:28:29.4+00	t	images/project/tp.jpeg	images/project/banner/tp.jpeg
5	Rueben Drive	Rolleston	Bathroom Project	Light Up Your Bathroom	reuben-drive	| Designed with the family in mind this Rolleston home makes the most of LED mirror lighting...	<h3>The first thing you notice when you walk into the bathrooms in this modern home in Rolleston is the stunning, large, LED Mirrors hanging above the vanity.</h3>\r\n\r\n<p>The Broadway LED mirror is a statement piece for a modern bathroom. Activated by a touchless sensor, simply wave your hand below the mirror to bathe the room in a cool white glow.</p>\r\n\r\n<p>Alongside the LED mirror in the main bathroom we have the Citi 1200 wall hung vanity in Hickory Oak, and the Newark Corner back-to-wall freestanding bath.</p>\r\n\r\n<p>In the 2nd bathroom is the Citi 1200 vanity, double basin, in Hickory Oak, the Broadway LED Mirror, the Castello toilet and the Quadro Heated Towel Rail in Chrome.</p>\r\n\r\n<p>Photos credit of&nbsp;<a href="https://btbuilders.co.nz/" rel="noopener" target="_blank" title="Beautiful Bathrooms in Rolleston">BT Builders</a></p>		2023-04-14 10:30:37.376+00	t	images/project/rdr.jpeg	images/project/banner/rdr.jpeg
6	Washed Oak Ravani	Auckland	Auckland	A Scandinavian Flavour	washed-oak-bathroom-project	A scandinavian design with Washed Oak bathroom vanities matched with LED mirrors...	<p>This bathroom project in Auckland showcases a range of Newtech solid timber bathroom vanities.</p>\r\n\r\n<p>With Washed Oak being the flavour of the day, this gives a nice contrast to the darker tones they have used in the wall tiles.</p>\r\n\r\n<p>Complemented with our Broadway LED mirror, Castello Toilet and Kolum tower unit. In the small washroom, they have used the Tivoli wall hung vanity, which is a great option for those smaller spaces.</p>		2023-04-14 10:32:31.378+00	t	images/project/wor.jpeg	images/project/banner/wor.jpeg
7	Waiuku		Modern Bathroom Renovation In Waiuku	A luxurious modern day family bathroom in Waiuku.	waiuku	A luxurious modern day family bathroom in Waiuku. The brief was to create an eco, energy...	<p>The brief was to&nbsp;create an eco, energy efficient bathroom with plenty of functional&nbsp;smart storage &ndash; and they have done just that!</p>\r\n\r\n<p>Along with the bathroom accessories, appliances and styling, they have incorporated<br />\r\nthe Newtech Wall Hung Ravani vanity in American Walnut grain. Making use of the offset<br />\r\nbasin option provides plenty of bench space to the right of the vessel basin.</p>\r\n\r\n<p>The 1200mm Ravani Vanity has two large soft close drawers which provide great storage.</p>\r\n\r\n<p><strong>Planning your next project?</strong>&nbsp;Why not incorporate a natural wood grain piece into your<br />\r\nbathroom that you know you can rely on for strength and stability. Crafting premium<br />\r\nquality furniture that will stand the test of time.</p>\r\n\r\n<p>Contact us today on&nbsp;<strong>0800 728 662</strong>&nbsp;or email your plan to&nbsp;<strong>sales@newtech.co.nz.</strong></p>		2023-04-14 10:35:50.023+00	t	images/project/w.jpeg	images/project/banner/w.jpeg
8	Alba Takapuna			Tailored to those seeking a lifestyle in a vibrant urban hub.	alba-takapuna	lba Takapuna is a recently completed boutique complex of just 19 high quality apartments...	<h3>A mix&nbsp;of 1, 2, 3 bedroom apartments have been well designed&nbsp;and feature a Newtech custom-made 2 Drawer Wall Hung&nbsp;Vanity along with an Evoke 7-Bar Heated Towel Rail.</h3>\r\n\r\n<p>The Alba custom-made vanities feature a specially sourced laminate finish<br />\r\nand offer plenty of storage with two large soft drawers and finished with<br />\r\nJulius stainless steel handles. The Evoke 7-Bar heated towel rail in high<br />\r\nquality durable stainless steel adds a practical element.</p>\r\n\r\n<p><strong>Considering using custom-made products in your next project?&nbsp;</strong>We specialise in custom-made products of all sizes and can work to your&nbsp;design specification and budget. Contact us today on&nbsp;<strong>0800 728 662&nbsp;</strong>or email your plan to&nbsp;<strong>sales@newtech.co.nz</strong>.</p>		2023-04-14 10:37:58.885+00	t	images/project/at.jpeg	images/project/banner/at.jpeg
